import Jumbotron from '../components/Jumbotron';
import Navbar from '../components/Navbar';
import About from '../components/About';
import htmlimg from '../static/images/HTML.png';
import cssimg from '../static/images/CSS.png';
import jsimg from '../static/images/JAVASCRIPT.png';
import nodeimg from '../static/images/NODE.png';
import reactimg from '../static/images/REACT.png';

export default function Index() {
  return (
    <div>
      <Jumbotron/>
      <Navbar/>
      <About />
      <section className="tools">
          <h2>TOOLS</h2>
          <div className="container">
              <section className="satu">
                  <figure>
                      <img src={htmlimg} alt={htmlimg}/>
                      <figcaption><p>HTML 5 is markup language for structuring and displaying content from World Wide Web, a core technology of the internet. HTML 5 is the fifth revision of HTML and as of June 2011 it is still under development.</p></figcaption>
                  </figure>
                  <figure>
                      <img src={cssimg} alt={cssimg}/>
                      <figcaption><h4>CSS 3</h4></figcaption>
                  </figure>
                  <figure>
                      <img src={jsimg} alt={jsimg}/>
                      <figcaption><h4>JAVASCRIPT</h4></figcaption>
                  </figure>
              </section>
              <section className="dua">
                  <figure>
                      <img src={reactimg} alt={reactimg}/>
                      <figcaption><h4>REACT</h4></figcaption>
                  </figure>
                  <figure>
                      <img src={nodeimg} alt={nodeimg}/>
                      <figcaption><h4>NODE JS</h4></figcaption>
                  </figure>
              </section>
          </div>
          <style jsx>{`
            .container {
                text-align: center;
            }
            h2 {
                text-align: center;
            }
            section .satu,.dua{
                display: flex;
                justify-content: center;
            }
            figure {
                box-sizing: border-box;
                padding: 0 20px;
                margin: 20px;
            }
            img {
                width: 330px;
                height: 234px;
            }
          `}</style>
      </section>
    </div>
  )
}
